// src/pages/ReviewData.tsx
import React, { useMemo, useState } from 'react';
import { useNavigate } from 'react-router-dom';
import {
  Container,
  Box,
  Typography,
  Button,
  Paper,
  Card,
  CardContent,
  Divider,
  CircularProgress,
  Alert
} from '@mui/material';
import styled from 'styled-components';
import { useVan } from '../contexts/VanContext';
import { apiService } from '../services/api.service';
import Sidebar from '../components/Sidebar';

interface InfoSectionProps {
  title: string;
  children: React.ReactNode;
}

const StyledContent = styled(Box)`
  margin-left: 300px;
  padding: 24px;
`;

const InfoSection: React.FC<InfoSectionProps> = ({ title, children }) => (
  <Box sx={{ mb: 3 }}>
    <Typography variant="h6" gutterBottom color="primary">
      {title}
    </Typography>
    {children}
  </Box>
);

function ReviewData(): React.ReactElement {
  const navigate = useNavigate();
  const { vanData } = useVan();
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState<string | null>(null);

  const backupData = useMemo(() => {
    try {
      const savedData = localStorage.getItem('companyData');
      return savedData ? JSON.parse(savedData) : null;
    } catch (error) {
      console.error('Erro ao carregar dados do localStorage:', error);
      return null;
    }
  }, []);

  const formattedData = useMemo(() => {
    const data = vanData.companyData || backupData || {};
    return {
      empresa: {
        nome: data.razaoSocial || '[NOME DA EMPRESA]',
        cnpj: data.cnpj || '[CNPJ DA EMPRESA]'
      },
      responsavel: {
        nome: data.responsavelNome || '[NOME DO RESPONSÁVEL DA EMPRESA]',
        email: data.responsavelEmail || '[E-MAIL DO RESPONSÁVEL DA EMPRESA]',
        telefone: data.responsavelTelefone || '[TELEFONE DO RESPONSÁVEL DA EMPRESA]'
      },
      conta: {
        banco: vanData.selectedBank?.name || data.banco || '[NOME DO BANCO]',
        agencia: data.agencia || '[AGÊNCIA DO BANCO]',
        conta: data.conta || '[CONTA DA EMPRESA]',
        convenio: data.convenio || '[CONVÊNIO DA EMPRESA]'
      },
      gerente: {
        nome: data.gerenteConta || '[NOME GERENTE DA CONTA]',
        email: data.gerenteEmail || '[E-MAIL GERENTE DA CONTA]',
        telefone: data.gerenteTelefone || '[TELEFONE GERENTE DA CONTA]'
      }
    };
  }, [vanData, backupData]);

  const handleSubmit = async (): Promise<void> => {
    try {
      setLoading(true);
      setError(null);

      const companyData = vanData.companyData || backupData;
      if (!companyData) {
        setError('Dados da empresa não encontrados.');
        setLoading(false);
        return;
      }

      await apiService.sendVanRequest(companyData);
      navigate('/success');
    } catch (err) {
      console.error(err);
      setError('Erro ao enviar os dados. Tente novamente.');
    } finally {
      setLoading(false);
    }
  };

  return (
    <Box>
      <Box
        sx={{
          height: '64px',
          backgroundColor: 'primary.main',
          display: 'flex',
          alignItems: 'center',
          padding: '0 24px',
          position: 'fixed',
          top: 0,
          left: 0,
          right: 0,
          zIndex: 1000,
        }}
      >
        <img src="/tecno_branca.png" alt="Tecnospeed" style={{ height: '30px' }} />
      </Box>

      <Sidebar />

      <StyledContent>
        <Container maxWidth="md" sx={{ mt: 8 }}>
          <Typography variant="h5" gutterBottom>
            4. Conferir e Validar Dados
          </Typography>
          <Typography variant="body1" color="text.secondary" gutterBottom>
            Revise os dados preenchidos antes de enviar a solicitação ao banco.
          </Typography>

          {error && <Alert severity="error" sx={{ mt: 2 }}>{error}</Alert>}

          <Card sx={{ mt: 4 }}>
            <CardContent>
              <InfoSection title="Empresa">
                <Typography>Razão Social: {formattedData.empresa.nome}</Typography>
                <Typography>CNPJ: {formattedData.empresa.cnpj}</Typography>
              </InfoSection>

              <Divider sx={{ my: 2 }} />

              <InfoSection title="Responsável">
                <Typography>Nome: {formattedData.responsavel.nome}</Typography>
                <Typography>Telefone: {formattedData.responsavel.telefone}</Typography>
                <Typography>Email: {formattedData.responsavel.email}</Typography>
              </InfoSection>

              <Divider sx={{ my: 2 }} />

              <InfoSection title="Conta Bancária">
                <Typography>Banco: {formattedData.conta.banco}</Typography>
                <Typography>Agência: {formattedData.conta.agencia}</Typography>
                <Typography>Conta: {formattedData.conta.conta}</Typography>
                <Typography>Convênio: {formattedData.conta.convenio}</Typography>
              </InfoSection>

              <Divider sx={{ my: 2 }} />

              <InfoSection title="Gerente da Conta">
                <Typography>Nome: {formattedData.gerente.nome}</Typography>
                <Typography>Telefone: {formattedData.gerente.telefone}</Typography>
                <Typography>Email: {formattedData.gerente.email}</Typography>
              </InfoSection>

              <Box sx={{ display: 'flex', justifyContent: 'space-between', mt: 4 }}>
                <Button variant="outlined" onClick={() => navigate('/company-data')}>
                  Voltar
                </Button>
                <Button
                  variant="contained"
                  onClick={handleSubmit}
                  disabled={loading}
                  startIcon={loading && <CircularProgress size={20} />}
                >
                  Enviar
                </Button>
              </Box>
            </CardContent>
          </Card>
        </Container>
      </StyledContent>
    </Box>
  );
}

export default ReviewData;
